ISLAMABAD, June 29 (APP): Women Members of Parliament (MPs) including Senator Seemi Ezdi and Members of the National Assembly (MNAs) Andleeb Abbas, Shanila Ruth, Nusrat Wahid and Ghazala Saifi called on Prime Minister Imran Khan here on Tuesday.
During the meeting, the matter relating budget were discussed.
